"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'宋体\'; font-size:12pt;\">对于需要加密的明文，输入到明文框，再点击加密按钮即可，注意明文必须为</span><span style=\" font-size:12pt;\">ascii</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">编码字符，当用户输入其它字符时，系统会弹窗告诉用户输入错误，如下图：</span><span style=\" font-size:12pt;\"> </span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><img src=\":/帮助文档-随机数生成/help-3-95.png\" /></p>\n"
